CREATE TABLE IF NOT EXISTS "teacherview_status" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(1) NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "department" varchar(64) NOT NULL, "achievements" text NOT NULL);
CREATE TABLE IF NOT EXISTS "studentview_registrations" ("registration_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "student_name" varchar(64) NOT NULL, "student_class" integer NOT NULL, "student_section" varchar(1) NOT NULL, "event_id" integer NOT NULL, "subevent_id" integer NOT NULL, "reg_info" text NOT NULL, "reg_status" varchar(1) NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "event_type" varchar(1) NOT NULL, "group_id" integer NOT NULL, "date_applied" date NOT NULL);
